// parentComp.js

import React, { useState, useEffect } from 'react';
import apiService from '../../apiService';
import ElectionsList from './electionList'; // Adjust the import path

const ParentComponent = () => {
  const [electionsData, setElectionsData] = useState([]);

  const fetchData = async () => {
    try {
      const userId = localStorage.getItem('ID');
      const token = localStorage.getItem('authToken');
      const data = await apiService.getelections(userId, token);
      setElectionsData(data.elections); // Assuming 'elections' is the array property in the response
      console.log("Test")
      console.log(setElectionsData)
    } catch (error) {
      console.error('Error fetching elections:', error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []); // Fetch data on component mount

  return (
    <div>
      {electionsData.map((election) => (
        <ElectionsList
          key={election.ElectionID}
          electionid={election.ElectionID}
          title={election.Title}
          description={election.Description}
          startdate={election.StartDate}
          enddate={election.EndDate}
        />
      ))}
    </div>
  );
};

export default ParentComponent;
